import React from 'react'

const Thumbnails = ({ foods }) => {
  return (
    <ul className={classes.list}>
     {
        foods.map((food => 
            <li key={food.id}>
                <Link to={`/food/${food.id}`}>
                    <img className={classes.image} 
                    src={`/food/${food.imageUrl}`}
                    alt={food.name}
                    />
                </Link>
            </li>
        ))
     }
   </ul>
  )
}

export default Thumbnails
